import { element } from "prop-types"

const Header = (props) => {
  return (
    <>
      <h1>{props.course}</h1>
    </>
  )
}

const Part = part => {
  return (
    <>
      <p>
        {part.part.name} {part.part.exercises}
      </p>
    </>
  )
}

const Content = p => {
  console.log(p)
  return (
    <div>
      <Part part={p[0]}/>
      <Part part={p[1]}/>
      <Part part={p[2]}/>
     </div>
  )
}

const Total = (props) => {
  return (
    <>
      <p>
        Number of exercises {props.first + props.second + props.third}
      </p>
    </>
  )
}
const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (
    <div>
      <Header course={course}/>
      <Content p={parts}/>
      <Total p={parts}/> 
    </div>
  )
}

export default App
